import React from "react";

function ResultFooter1() {
   
 

    return (
          <div>
          <div className="signatures">
          <div className="signature">
          <hr className="signature-line" />
            সভাপতির প্রতিস্বাক্ষর (তারিখসহ)
          </div>
          <div>
          <hr className="signature-line"/>
            পরীক্ষকের স্বাক্ষর
          </div>
        </div>
        </div>
      
    );
  }
  
  export default ResultFooter1;
